export const menu = [
    {
        id: 'home',
        title: 'Início',
        type: 'item',
        icon: 'home',
        url: 'home'
    },
    {
        id: 'provider',
        title: 'Fornecedores',
        type: 'item',
        icon: 'truck',
        url: 'fornecedores'
    },
    {
        id: 'pages',
        title: 'Despesas',
        type: 'collapsible',
        icon: 'file-text',
        children: [
            {
                id: 'login-v1',
                title: 'Listar',
                type: 'item',
                url: 'pages/authentication/login-v1',
            },
            {
                id: 'parameters',
                title: 'Parâmetros',
                type: 'collapsible',
                icon: 'circle',
                children: [
                    {
                        id: 'login-v1',
                        title: 'Categoria',
                        type: 'item',
                        url: 'pages/authentication/login-v1'
                    }
                ]
            }
        ]
    }
];
